export class dragon {
    constructor(name, origin, style, wings, legs, lengthMeters, weightKilos, flight, magical, description) {
        this.name = name;
        this.origin = origin;
        this.style = style;
        this.wings = wings;
        this.legs = legs;
        this.lengthMeters = lengthMeters;
        this.weightKilos = weightKilos;
        this.flight = flight;
        this.magical = magical;
        this.description = description;
    }
}
